window.bookSummaryJSON = "<p>The world of Alaria is changing, and the goddess who created it has no idea why.<br> On the eve of the apocalypse, Liam is transported to another world, along with his house....</p> <p>Liam was waiting for his father to come home from work when the house shook, and two moons appeared overhead. Stranded within a land where he doesn't speak the language and people are set on attacking him, he must survive in this new land where nothing makes sense.</p> <p>A gorgeous princess holds the key to him learning about this new world he has found himself in, and little of it is good news. First up, learning why people keep attacking his house.</p>"; 
